// Gestione cross-origin con cy.origin
cy.origin('https://demoqa.com', () => {
  // Visita la pagina del form DemoQA
  cy.visit('/text-box');
  // Compila il form
  cy.get('#userName').type('Marco');
  cy.get('#userEmail').type('marco@example.com');
  cy.get('#currentAddress').type('Via Roma 1');
  cy.get('#permanentAddress').type('Via Milano 2');
  // Submit del form
  cy.get('#submit').click();
  // Verifica che il nome inserito appaia nella conferma
  cy.get('#output #name').should('contain.text', 'Marco');
});
